Before starting anything, make sure your device is connected to Cumulocity . Step 0 Unless you installed c8y-configuration-plugin using the debian package, you need one additional step to initialize the plugin. Run this command. sudo c8y-configuration-plugin --init Step 1 Open the file /etc/tedge/c8y/c8y-configuration-plugin.toml and add entries for the configuration files that you'd like to manage from Cumulocity cloud in the following format: files = [ { path = '/etc/tedge/tedge.toml', type = 'tedge.toml'}, { path = '/etc/tedge/mosquitto-conf/c8y-bridge.conf', type = 'c8y-bridge.conf' }, { path = '/etc/tedge/mosquitto-conf/tedge-mosquitto.conf', type = 'tedge-mosquitto.conf' }, { path = '/etc/mosquitto/mosquitto.conf', type = 'mosquitto.conf' }, { path = '/etc/tedge/c8y/example.txt', type = 'example', user = 'tedge', group = 'tedge', mode = 0o444 }
] path is the full path to the configuration file. type is a unique alias for each file entry which will be used to represent that file in Cumulocity UI. user, group and mode are UNIX file permission settings to be used to create a configuration file. If not provided, the files will be created with root user. If the file exists already, its ownership will be retained. For more details on this configuration file format, refer to the reference guide . Note: You can also configure the c8y-configuration-plugin.toml from the cloud later. Step 2 Start the configuration plugin process and enable it on boot by systemctl (recommended). sudo systemctl start c8y-configuration-plugin.service
sudo systemctl enable c8y-configuration-plugin.service Alternatively, you can run the process directly. sudo c8y-configuration-plugin Step 3 Navigate to your Cumulocity Device Management and the desired device. Open its Configuration tab. You can find c8y-configuration-plugin and more are listed as supported configuration types, as declared in the plugin configuration file in step 1. Cumulocity Configuration Management Upload This is the configuration file of c8y-configuration-plugin, where you can add file entries that you want to manage with Cumulocity.

