Note: Child device measurements are not supported yet on Azure IoT Hub. The Azure IoT Hub mapper takes messages formatted in the Thin Edge JSON as input. It validates if the incoming message is correctly formatted Thin Edge JSON, then outputs the message. The validated messages are published on the topic az/messages/events/ from where they are forwarded to Azure IoT Hub. This mapper is launched by the tedge connect az command, and stopped by the tedge disconnect az command. The Azure IoT Hub Mapper processes a message in the following ways. Validates if it is a correct Thin Edge JSON message or not. Validates the incoming message size is below 255 KB. The size of all device-to-cloud messages must be up to 256 KB . The mapper keeps 1 KB as a buffer for the strings added by Azure. (default) Adds a current timestamp if a timestamp is not included in an incoming message. To stop this behavior, please refer to the following instruction. So, if the input is below, { "temperature": 23
} the output of the mapper is { "temperature": 23, "time": "2021-06-01T17:24:48.709803664+02:00"
}

