An alarm can be raised on thin-edge.io by sending an MQTT message in Thin Edge JSON format to certain MQTT topics. The scheme of the topic to publish the alarm data is as follows: tedge/alarms/<severity>/<alarm-type> The payload format must be as follows: { "text": "<alarm text>", "time": "<Timestamp in ISO-8601 format>"
} Note: These messages must be sent with MQTT retained flag enabled and with QOS > 1 to ensure guaranteed processing by thin-edge.io. Enabling the retained flag ensures that the alarm stays persisted with the MQTT broker until its state changes again. These retained messages will make sure that the thin-edge.io processes or any other third-party processes subscribed to these alarms will get those, even if they were down at the moment the alarm was raised. If multiple messages are sent to the same alarm topic, the last alarm is considered to have overwritten the previous one. Here is a sample alarm raised for temperature_high alarm type with critical severity: Topic: tedge/alarms/critical/temperature_high Payload: { "text": "Temperature is very high", "time": "2021-01-01T05:30:45+00:00"
} Note: Both the text field and the time field are optional. When a text is not provided, it is assumed to be empty. When time is not provided, thin-edge.io will use the current system time as the time of the alarm. When you want to skip both fields, use an empty json fragment {} as the payload to indicate the same. An empty message can't be used for the same, as empty messages are used to clear alarms, which is discussed in the next section. The <severity> value in the MQTT topic can only be one of the following values: critical major minor warning There are no such restrictions on the <alarm-type> value. Thin-edge.io doesn't keep any history of all alarms raised on an alarm topic.

