An event can be triggered on thin-edge.io by sending an MQTT message in Thin Edge JSON format to certain MQTT topics. The scheme of the topic to publish the event data is as follows: tedge/events/<event-type> The payload format must be as follows: { "text": "<event text>", "time": "<Timestamp in ISO-8601 format>"
} Here is a sample event triggered for a login_event event type: Topic: tedge/events/login_event Payload: { "text": "A user just logged in", "time": "2021-01-01T05:30:45+00:00"
} Note: Both the text field and the time field are optional. When the message field is not provided, the event-type from the MQTT topic will be used as the message as well if the connected cloud mandates one. When the time field is not provided, thin-edge.io will use the current system time as the time of the event. When you want to skip both fields, use an empty payload to indicate the same. There are no such restrictions on the <event-type> value.

